import React from 'react';
import useStore from '../store/main'
import {Link} from 'react-router-dom';
import './Nav.css';

const MainNav = () => {

    const {changeLogPage, insideNav} = useStore(state => state)


    return (
        <div className='nav_con'>
            {!insideNav ? (
                <ul>
                    <Link to={"/"}>
                        <li onClick={() => changeLogPage(false)}>Registration</li>
                    </Link>
                    <Link to={"/logIn"}>
                        <li onClick={() => changeLogPage(true)}>LogIn</li>
                    </Link>
                </ul>
            ):
                <>
                    <ul>
                        <Link to={"/cards"}>
                            <li>Color Cards</li>
                        </Link>
                        <Link to={"/users"}>
                            <li>Users</li>
                        </Link>
                        <Link to={"/icons"}>
                            <li>Icons</li>
                        </Link>
                    </ul>
                    <div>
                        <Link to={"/logIn"}>
                            <li>Log Out</li>
                        </Link>
                    </div>
                </>
            }
        </div>
    );
};

export default MainNav;
